import React from 'react';
import { useEffect } from 'react';

export default function Protected(props) {

    let Cmp = props.Cmp

    useEffect(()=>{
        if(!localStorage.getItem('auth_token')){
            navigate('/register');
        }
    },[])

    return (
        <div>
            <Cmp />
        </div>
    );
}
